# n8n Python Code Node
# Extract all TikTok comment texts and return them in one structured block under "Comment"

comments_list = []

def extract_texts(comments):
    for comment in comments:
        if "text" in comment and comment["text"]:
            comments_list.append({"text": comment["text"]})
        if "reply_comment" in comment and comment["reply_comment"]:
            extract_texts(comment["reply_comment"])

data = items[0].get("json", {})

if isinstance(data, list) and len(data) > 0 and "comments" in data[0]:
    extract_texts(data[0]["comments"])
elif "comments" in data:
    extract_texts(data["comments"])

return [{
    "json": {
        "Comment": comments_list
    }
}]
